  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Individuals with multiple chronic conditions
  (MCC) present many challenges to the health care system, such as effective coordination
  of care and cost containment. To assist health policy makers and to fill research
  gaps on MCC, we describe state-level variation of MCC among Medicare beneficiaries,
  with a focus on those with six or more conditions.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
